import HomeNavbar from "../../../components/HomeNavbar/HomeNavbar";
import "./AcademicBlog.css";
import BlogItem from "../../../components/BlogItem";
import { Link } from "react-router-dom";
const AcademicBlog = () => {
  return (
    <div className="academic-blog">
      <HomeNavbar />
      <p className="empty"></p>
      <p className="medium-header">Check Out Sample Assignments Below</p>
      <div className="container">
        <div className="search_container flex">
          <Link to="#" className="description">
            <p>All Posts</p>
            <p><i class="fa-solid fa-arrow-right"></i></p>
          </Link>
          <div className="search_bar flex">
            <input type="text" placeholder="Type the blog title..." />
            <i class="fa-solid fa-magnifying-glass"></i>
          </div>
        </div>
        <div className="blogs">
          <BlogItem/>
          <BlogItem/>
          <BlogItem/>
          <BlogItem/>
          <BlogItem/>
          <BlogItem/>
        </div>
      </div>
    </div>
  );
};

export default AcademicBlog;
